import React, { useState, useEffect } from "react";
import styled from "styled-components";

const StringsList = (stringList) => {

  return <ListContainer>
      { stringList.map((str) => (
          <li> { str } </li>
      )) }
      </ListContainer>;
};

const ListContainer = styled.ul`
  list-style: none;
  padding: 0;
`;

export default StringsList;
